import styled from 'styled-components';

const PriceTag = styled.span`
  background: rgba(0, 0, 15, 0.3);
  color: white;
  font-weight: 700;
  padding: 10px;
  line-height: 1;
  font-size: 3rem;
  display: inline-block;
  position: absolute;
  min-width: 90%;
  max-width: 90%;
`;

export default PriceTag;
